import './App.css';

function App() {
  return (
    <div className="App">

      <div className="Container">
      <div className="QuestionText">
        <h1>#1 Quelle plante utilise-t-on pour parfumer les pudres ?</h1>
      </div>
        <div className="QuestionImages">
        </div>
        <div className="Footer">
          <p>designed by EPITECH</p>
        </div>
      </div>
    </div>
  );
}

export default App;
